import React, { useState } from "react";
import { createClient } from "pexels";

export default function Gallery(param) {
  const [gallery, setGallery] = useState([]);
  const client = createClient(
    "63492ad6f91700001000001f84a1e01968f44b59b29eee146db0a50"
  );
  const query = param.word;
  client.photos
    .search({ query, total_results: 3, orientation: "square", size: "small" })
    .then((photos) => setGallery(photos));

  console.log(gallery);

  return <div className="Gallery">{param.word}</div>;
}
